origin.p:
The gradings used (prime / secunde dignitatis, commune festum, more octavarum) as well as the celebration of several Augustinian saints (e.g. St John of Bridlington (duplex)) reveal Augustinian use (cf. 
    Wormald (1938)

). The celebration of St Mary Magdalen (22 July), graded as prime dignitatis, with octave and her translation (19 March; both duplex) suggest Tonbridge Priory (cf. 
    Richards (1985)

).
